import React, { useEffect, useState } from "react";
import Navbar from "../MainPage/Navbar";
import "../../css/PatientDashboard.css";

export default function PatientDashboard() {
  const [patientName, setPatientName] = useState("Alok");
  const [appointments, setAppointments] = useState([]);
  const [prescriptions, setPrescriptions] = useState([]);
  const [notifications, setNotifications] = useState([]);
  const [billingHistory, setBillingHistory] = useState([]);

  useEffect(() => {
    setAppointments([
      { date: "2025-04-10", doctor: "Dr. Mehta", department: "Cardiology" },
      { date: "2025-04-15", doctor: "Dr. Singh", department: "Dermatology" },
    ]);
    setPrescriptions([
      { date: "2025-03-20", file: "prescription1.pdf" },
      { date: "2025-03-30", file: "prescription2.pdf" },
    ]);
    setNotifications([
      { message: "New test result uploaded." },
      { message: "Appointment with Dr. Mehta tomorrow at 10AM." },
    ]);
    setBillingHistory([
      { date: "2025-03-15", amount: "‚Çπ1200", service: "General Checkup" },
      { date: "2025-03-28", amount: "‚Çπ900", service: "Blood Test" },
    ]);
  }, []);

  return (
    <div>
      <Navbar />
      <div className="dashboard-wrapper">
        <h2 className="dashboard-title">Welcome, {patientName} üëã</h2>

        <div className="dashboard-grid">
          <div className="card">
            <h3>üìÅ Health Records</h3>
            <p>You have {prescriptions.length} recent prescriptions.</p>
          </div>

          <div className="card">
            <h3>üìÖ Upcoming Appointments</h3>
            <ul>
              {appointments.map((apt, i) => (
                <li key={i}>
                  <strong>{apt.date}</strong> - {apt.doctor} ({apt.department})
                </li>
              ))}
            </ul>
          </div>

          <div className="card">
            <h3>‚ûï Book Appointment</h3>
            <button className="btn-primary">Book Now</button>
          </div>

          <div className="card">
            <h3>üìú Prescriptions</h3>
            <ul>
              {prescriptions.map((pres, i) => (
                <li key={i}>
                  <a href="#">{pres.file}</a> <span>({pres.date})</span>
                </li>
              ))}
            </ul>
          </div>

          <div className="card">
            <h3>üîî Notifications</h3>
            <ul>
              {notifications.map((note, i) => (
                <li key={i}>{note.message}</li>
              ))}
            </ul>
          </div>

          <div className="card">
            <h3>üí≥ Billing History</h3>
            <ul>
              {billingHistory.map((bill, i) => (
                <li key={i}>
                  {bill.date} - {bill.service}: <strong>{bill.amount}</strong>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}
